const initialState = {
    windows : [
        {color: '',position : ''},{color: '',position : ''},{color: '',position : ''}
        ,{color: '',position : ''},{color: '',position : ''},{color: '',position : ''}
        ,{color: '',position : ''},{color: '',position : ''},{color: '',position : ''}
    ],
    door : 'white',
    roof : 'black',
    body : 'black'
};

const HouseReducer =(state = initialState , action)=>{
    switch (action.type) {
        case 'WINDOW_COLOR_CHANGE':
            console.log(initialState.windows)
            return state;
        default:
            return state;
    }
};

export default HouseReducer;
